import React from 'react'

const Admin_view_users = () => {
  return (
    <div className='text-white'>
      <div className='max-w-[800px] mt-[96px] w-full mx-auto my-auto text-left flex flex-col'>

        <h1 className='md:text-7xl sm:text-6xl text-4xl font-bold md:py-6'>Users</h1>
      </div>

    </div>
  )
}

export default Admin_view_users
